import React from 'react';
import './Project.css';
import projectimages from '../ImagesLogo/netflix landing.png';

function Project() {
    return (
        <div className='projects'>
            <div className="project-title">
                <h1>Projects</h1>
            </div>
            <div className="project-all" >
                {data.map((h) =>
                    <div key={h.id} className='project-lists'>
                        <h4>{h.Name}</h4>
                        <img src={h.img} alt='' style={{width:'280px'}} />
                        <div className="project-info">
                            <p>Lorem ipsum dolor, sit amet consectetur adipisicing elit. Impedit, accusamus?</p>
                            <Link/>
                        </div>
                    </div>
                )}
            </div>
        </div>
    )
}

const data = [
    {
        id: 1,
        Name: 'Netflix Landing Page',
        img: projectimages
    },
    {
        id: 2,
        Name: 'Netflix Landing Page',
        img: projectimages
    },
    {
        id: 3,
        Name: 'Netflix Landing Page',
        img: projectimages
    },
    {
        id: 4,
        Name: 'Netflix Landing Page',
        img: projectimages
    },
]

export default Project
